import React from "react";
import styled from "styled-components";

export default function DonationDetailsContainer() {
  return (
    <div>
      <MainContainer>
        <ThankingToDonor>
          <p>Thanking To Medicana Donor</p>
        </ThankingToDonor>
        <DetailsOfThankingToDonor>
          <InformationOfDonors>
            <p>
              Lorem ipsum dolor, sit amet consectetur adipisicing elit. Pariatur
              laudantium fuga deleniti veritatis qui culpa molestias minus, ea
              illo reprehenderit magni sit assumenda corrupti quasi est ex fugit
              aliquid, ipsa nemo fugiat necessitatibus obcaecati. Lorem ipsum
              dolor sit amet consectetur adipisicing elit. Alias harum, omnis
              quo in, ullam facilis autem totam dolorum reiciendis ratione natus
              veniam cum similique suscipit cupiditate. Consequuntur consequatur
              distinctio non sit architecto repellendus impedit!
            </p>
          </InformationOfDonors>
          {details.map((item, index) => {
            return (
              <TreatmentDetails>
                <TypesOfTreatment>
                  <p key={index}>{item.Treatment}</p>
                </TypesOfTreatment>
                <TreatmentInfo>
                  <TreatmentInfoContainer>
                    <TreatmentDetailWithImageSlider>
                      <TreatmentInformation>
                        <p key={index}>{item.TreamtentDetail}</p>
                      </TreatmentInformation>
                      <TreatmentSlider>
                        <InnerImgSlider data={item.data} index={index} />
                      </TreatmentSlider>
                    </TreatmentDetailWithImageSlider>
                    <ExampleOfTreatment>
                      <p key={index}>
                        {item.ExampleOfTreatmentAvailableHeading}
                      </p>
                      <TreatmentContainer>
                        {item.ExampleOfTreatmentAvailable.map((x, i) => {
                          return <li>{x.treatment}</li>;
                        })}
                      </TreatmentContainer>
                    </ExampleOfTreatment>
                  </TreatmentInfoContainer>
                </TreatmentInfo>
              </TreatmentDetails>
            );
          })}
        </DetailsOfThankingToDonor>
      </MainContainer>
    </div>
  );
}

const MainContainer = styled.div`
  width: 90%;
  position: relative;
  left: 95px;
  top: 40px;
  text-align: center;
`;

const ThankingToDonor = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  margin: 3%;

  p {
    text-align: center;
    font-family: "Bree Serif", serif;
    font-size: 2rem;
    color: white;
    font-weight: bold;
    display: inline-flex;
    padding: 10px;
    box-shadow: rgba(0, 0, 0, 0.1) 0px 2px 4px, rgba(0, 0, 0, 0.1) 0px 8px 16px;
    background-color: rgb(255, 255, 255);
    color: #090b13;
    border-radius: 5px;
    word-spacing: 0.5rem;
    line-height: 1.4rem;
  }
`;

const DetailsOfThankingToDonor = styled.div`
  box-shadow: rgba(0, 0, 0, 0.1) 0px 2px 4px, rgba(0, 0, 0, 0.1) 0px 8px 16px;
  border-radius: 5px;
  background-color: white;
`;

const InformationOfDonors = styled.div`
  display: flex;
  flex-direction: column;
  flex-wrap: wrap;
  align-items: center;
  justify-content: center;
  margin: 3%;
  p {
    text-align: center;
    color: #090b13;
    font-family: "Roboto", sans-serif;
    word-spacing: 0.5rem;
    line-height: 1.4rem;
    box-sizing: border-box;
    margin-top: 10px;
  }
`;

const TreatmentDetails = styled.div`
  box-shadow: rgba(0, 0, 0, 0.1) 0px 2px 4px, rgba(0, 0, 0, 0.1) 0px 8px 16px;
  border-radius: 5px;
  background-color: white;
  margin-top: 4%;
`;

// container for showing the meaning of the type of treatment
const TreatmentInfo = styled.div`
  width: 100%;
`;

const TypesOfTreatment = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  margin: 2%;

  p {
    text-align: center;
    font-family: "Bree Serif", serif;
    font-size: 1.5rem;
    color: white;
    border-radius: 5px;
    font-weight: bold;
    display: inline-flex;
    padding: 4px;
    margin-top: 30px;
    box-shadow: rgba(0, 0, 0, 0.1) 0px 2px 4px, rgba(0, 0, 0, 0.1) 0px 8px 16px;
    border-radius: 5px;
    background-color: white;
    color: #090b13;
  }
`;

const TreatmentInfoContainer = styled.div`
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: center;
  width: 100%;
`;

const TreatmentDetailWithImageSlider = styled.div`
  width: 75%;
  display: flex;
  flex-direction: column;
`;

const TreatmentInformation = styled.div`
  display: flex;
  flex-direction: column;
  flex-wrap: wrap;
  align-items: center;
  justify-content: center;
  margin: 2%;
  box-shadow: rgba(0, 0, 0, 0.1) 0px 2px 4px, rgba(0, 0, 0, 0.1) 0px 8px 16px;
  border-radius: 5px;
  padding: 3px;

  p {
    text-align: center;
    color: #090b13;
    font-family: "Roboto", sans-serif;
    word-spacing: 0.5rem;
    line-height: 1.4rem;
  }
`;

const TreatmentSlider = styled.div`
  width: 100%;
`;

const ExampleOfTreatment = styled.div`
  width: 100%;
  box-shadow: rgba(0, 0, 0, 0.1) 0px 2px 4px, rgba(0, 0, 0, 0.1) 0px 8px 16px;
  border-radius: 5px;
  padding: 3px;
  margin: 10px;
  background-color: rgb(240, 233, 223);
  p {
    text-align: center;
    color: #090b13;
    font-family: "Roboto", sans-serif;
    word-spacing: 0.5rem;
    line-height: 1.4rem;
    padding: 8px;
  }
`;

const TreatmentContainer = styled.div`
  padding: 4px;
  margin: 4px;

  li {
    text-align: left;
  }
`;
